import '../Styles/home.css'

function Home() {
    return(
        <div>
            <header>Welcome to Hatch Match</header>
            <p> This site will help you choose the correct fly to have the most success on the water</p>
            <p>Search for specific flies to learn about when and where to use them and how to present them effectivly</p>
            <p>Search for the species you are targeting to see what they have been biting</p>
            <p>Search for your region to see what bugs are hatching in your area</p>
        </div>
    )
}

export default Home;
